import React from "react";
import InfluencerNavbar from "../../components/InfluencerNavbar";

const Campaigns = () => {
  return (
    <>
      <InfluencerNavbar />
      <div className="p-10 text-center">
        <h1 className="text-3xl font-bold text-purple-600">Available Campaigns</h1>
        <p className="mt-4 text-gray-600">Browse and apply to campaigns that fit your vibe.</p>
      </div>
    </>
  );
};

export default Campaigns;
